  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:28.081956\",\n\t\"name\": \"lacreek-national-wildlife-refuge-annual-narrative-report-calendar-year-1987\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lacreek
  NWR outlines Refuge accomplishments during the 1987 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning
  and public participation. Refuge administration is outlined; information about personnel,
  youth programs, manpower programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, grasslands, grazing, haying, fire management, pest control,
  and water rights. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  fisheries resources, wildlife propagation, scientific collections, and marking and
  bird banding. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, fishing, trapping, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, communication systems, computer systems, and energy conservation. Cooperative
  programs and items of interest are provided at the end. Refuge brochures and field
  guides are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
